import React from "react";
import { useNavigate } from "react-router-dom"
import Card from 'react-bootstrap/Card'
import GetMatchups from '../../ApiRequests'

function Home() {

    const navigate = useNavigate()

    //Get all available matchups
    const getMatchups = () => {
        const response = getMatchups()

        console.log(response.data)
    }




    //display all matchups as a card

    //if you don't have that matchup yet as a selection, button to vote. Otherwise, can't vote. 



    return (
        <div className="">
            <div className="container" style={{paddingTop: '2rem'}}>
                <button onClick={() => getMatchups()}>testing</button>
                <Card style={{ width: '18rem' }}>
                    <Card.Body>
                        <Card.Title>leader board</Card.Title>
                        <Card.Subtitle className="mb-2 text-muted">Everyones points</Card.Subtitle>
                        <Card.Text>
                            Kurtis 20points
                        </Card.Text>
                        <Card.Link href="#">Card Link</Card.Link>
                        <Card.Link href="#">Another Link</Card.Link>
                    </Card.Body>
                </Card>

                <hr></hr>
                <Card style={{ width: '18rem' }}>
                    <Card.Body>
                        <Card.Title>Matchups</Card.Title>
                        <Card.Subtitle className="mb-2 text-muted">Card Subtitle</Card.Subtitle>
                        <Card.Text>
                            Some quick example text to build on the card title and make up the
                            bulk of the card's content.
                        </Card.Text>
                        <Card.Link href="#">Card Link</Card.Link>
                        <Card.Link href="#">Another Link</Card.Link>
                    </Card.Body>
                </Card>
            </div>
        </div>
    );
}

export default Home;
